import React from "react";
import i from '../image/12.webp';
const Nav = () =>{
    return (
        <div className="max-w-7xl mx-auto">
        <div className="flex flex-row items-center justify-between pt-12">
            <div className=" mt-8 space-y-2">
                <h2 className="text-2xl font-semibold font-normal tracking-normal">Подтягивайте знание</h2>
                <h1 className="text-3xl font-bold text-black">Доступно и эффективно</h1>
                <p className="text-xl">SDU Assistant - образовательная платформа для студентов СДУ, который поможет подтянуть знание в любое удобное время и достичь успеха.</p>
            </div>
            <div className="mt-8">
                <div className="w-1/2">
                    <img src={i}/>
                </div>
            </div>
        </div>
        </div>
    );

}

export default Nav;
